    /*  %     rindex_from    = (w_len - N_overlap)*(i-1) + 1;    % [   1 1302
     * 2603 3904] */
    /*  % %     index_till    = index_from + w_len - 1; */
    /*  % %     x             = data_down(index_from:index_till); % [4096 5397
     * 6698 7999] */
    /*  --------------------------------------------------------------------- */
    /*  Detrend START */
    /*  --------------------------------------------------------------------- */
    avg_end = dataStorage.modbus.b_x[0];
    /*  begining of signal */
    b_y = dataStorage.modbus.b_x[3896];
